{
   
    Cday day1;
    
    day1.nYear =      2022;
	
	day1.pszDay = "Monday";
	
	day1.nSec = 1688169600;
   
    printf("size Cday = %d\n", sizeof(day1) );
    printf("address day1 = %d\n", &day1);
    foo(day1);

}



