using UnityEngine;

public class MovSubeBaja : MonoBehaviour
{
    public float velocidadRotacion = 1f;
    public float radio = 1f;
    public float velocidadMovimiento = 1f;

    private float anguloX = 0f;
    private float anguloY = 0f;

    private void Update()
    {
        anguloX += velocidadRotacion * Time.deltaTime;
        anguloY += velocidadRotacion * Time.deltaTime;

        float x = Mathf.Sin(anguloX) * radio;
        float y = Mathf.Sin(anguloY) * radio;
        float z = transform.position.z;

        // Calcular el desplazamiento lateral
        float desplazamientoLateral = velocidadMovimiento * Time.deltaTime;

        // Calcular la posición resultante con el movimiento lateral
        Vector3 nuevaPosicion = new(transform.position.x - desplazamientoLateral, y, z);

        // Actualizar la posición del objeto
        transform.position = nuevaPosicion;
    }
}

