using UnityEngine;

public class MovSubeBajaCrazy : MonoBehaviour
{
    public float velocidadMovHor = 1f;
    public float amplitudVertical = 1f;
    public float velocidadMovVer = 1f;
    public float tiempoCambio = 2f; // Tiempo en segundos para cambiar el sentido de giro

    private Vector3 posicionInicial;
    private float posicionHorizontal;
    private bool invertirVelocidad = false;
    private float timer = 0f;

    private void Start()
    {
        posicionInicial = transform.position;
    }

    private void Update()
    {
        // Movimiento horizontal
        posicionHorizontal -= velocidadMovHor * Time.deltaTime;

        // Desplazamiento vertical
        float desplazamientoVertical = Mathf.Sin(Time.time * velocidadMovVer) * amplitudVertical;

        // Actualizar el temporizador
        timer += Time.deltaTime;

        // Verificar si ha pasado el tiempo de cambio
        if (timer >= tiempoCambio)
        {
            invertirVelocidad = !invertirVelocidad; // Invertir la velocidad
            timer = 0f; // Reiniciar el temporizador
        }

        // Calcular la velocidad modificada
        float velocidadModificada = invertirVelocidad ? -Mathf.Abs(velocidadMovVer) : Mathf.Abs(velocidadMovVer);

        // Actualizar la posición
        transform.position = new Vector3(posicionInicial.x + posicionHorizontal, posicionInicial.y + desplazamientoVertical, posicionInicial.z);

        // Actualizar la velocidad del movimiento vertical
        velocidadMovVer = velocidadModificada;
    }
}

